import style from "./SearchBar.module.css"

export default function SearchBar({onSearch}) {
    return (
       <div className={style.main} >
          <input type='search' placeholder="Buscar..."/>
          <button onClick={onSearch} className={style.btn}>Agregar</button>
       </div>
    );
 }
